import '../style/header.scss';


export default function Navigation() {
    return (
        
        <nav>
            <div className='nav'>
            <Link to="/src" exact className='link' activeClassName='underline'>
            <p>Acceuil</p>
            </Link>
            <Link to="/src/pages/About" className='link'>
            <p>A propos</p>
            </Link>
            </div>
        </nav>
    )
};
